import logo from './logo.svg';
import './App.css';
import Board from './Board';

function App() {
  const enemyChampions = [
    { startingPosition: { left: 0, top: 0 }, currentPosition: { left: 0, top: 0 }, image: "https://dotesports.com/wp-content/uploads/2023/11/Corki.png?w=640", type: "corki", starLevel: 1, headliner: false, items: [] },
    { startingPosition: { left: 1, top: 1 }, currentPosition: { left: 1, top: 1 }, image: "https://prod.api.assets.riotgames.com/public/v1/asset/lol/13.24.1/CHAMPION_SKIN/223020/SPLASH?width=1920&height=1080&format=auto&auto=webp", type: "tahm-kench", starLevel: 1, headliner: false, items: [] },
  ];

  const userChampions = [
    { startingPosition: { left: 4, top: 4 }, currentPosition: { left: 4, top: 4 }, image: "https://dotesports.com/wp-content/uploads/2023/11/Corki.png?w=640", type: "corki", starLevel: 1, headliner: false, items: [] },
    { startingPosition: { left: 6, top: 7 }, currentPosition: { left: 6, top: 7 }, image: "https://prod.api.assets.riotgames.com/public/v1/asset/lol/13.24.1/CHAMPION_SKIN/223020/SPLASH?width=1920&height=1080&format=auto&auto=webp", type: "tahm-kench", starLevel: 1, headliner: false, items: [] },
  ];

  return (
    <div className="App">
      <Board enemyChampions={enemyChampions} userChampions={userChampions} />
    </div>
  );
}

export default App;
